LED LAMP is designed for mobile phone users to meet their flexible intelligent control LED Bluetooth devices and multi-function switching needs.

feature of product:
1. Quickly add and switch the required software services. Currently available software services include: LED BLE, LED DMX, LED SMART, LED STAGE, LED LIGHT, and new services will be launched in the future. Please look forward to;
2, flexible choice of lighting color, 16 million kinds of lighting colors to provide choice;
3, the light provides red, green and blue brightness adjustment, while supporting monochromatic light, supporting multi-point timing control;
4, the light provides 210 kinds of colorful mode selection, while supporting speed and brightness adjustment;
5, to provide custom mode color selection for lighting, rich in content and flexible, while supporting speed and brightness adjustment;
6, the light supports music and microphone mode, the light follows the rhythm of music and microphone changes;
7, support a variety of color sorting options, point settings, chip encoding settings, timing functions, skin replacement;
8, the phone shakes to change the color and mode of the light;
9, remote control is not limited by the direction of the distance can reach more than 15 meters;

